            SystemDb systemDb = new SystemDb();
            TableObject table; table = new Table(); table.Type = TableType.Table; table.Id = 1; ; table.Name = "se.test"; systemDb.Objects.Add(table);
                                table = new Table(); table.Type = TableType.Table; table.Id = 2; ; table.Name = "se.test2"; systemDb.Objects.Add(table);
