            string proc = @"SELECT test FROM test2 JOIN andereDb.test";
            string expected = "SELECT test FROM `se`.`test2` JOIN `se`.`test`"; 
            string actual = systemDb.ModifyProcedure(proc, systemDb.Objects, "se");
            Assert.AreEqual(expected, actual);
        }


