        [TestMethod()]
        public void GetTableNamesAndComplexityNew_brackets() {
            SystemDb target = new SystemDb(); 
            string statement =
                @"FROM (((_atpos atpos 
INNER JOIN _at at
ON atpos.atkey = at.atkey)
INNER JOIN _prdvt prdvt 
ON atpos.atposkey = prdvt.atposkey) 
";
            Dictionary<string, long> tableObjectsNamesAndComplexity = new Dictionary<string, long>(){{"_atpos",0},{"_at",0},{"_prdvt",0}}; 
            
            Dictionary<string, long> actual = target.GetTableNamesAndComplexityNew(statement, tableObjectsNamesAndComplexity);
            foreach(var table in tableObjectsNamesAndComplexity.Keys)
                Assert.IsTrue(actual.ContainsKey(table),table + " existiert nicht");
        }

